import{_ as a,c as t,o as s,ag as n}from"./chunks/framework.Bw-5EFTY.js";const u=JSON.parse('{"title":"file","description":"","frontmatter":{},"headers":[],"relativePath":"en/docs/rules/file.md","filePath":"en/docs/rules/file.md"}'),o={name:"en/docs/rules/file.md"};function i(l,e,r,p,c,d){return s(),t("div",null,e[0]||(e[0]=[n(`<h1 id="file" tabindex="-1">file <a class="header-anchor" href="#file" aria-label="Permalink to &quot;file&quot;">​</a></h1><p>The <code>file</code> protocol is used to map requests to the local file system, returning the content of local files as responses to the client. It is suitable for the following scenarios:</p><ul><li><strong>Setting up a local development environment</strong>: Quickly set up a local development server.</li><li><strong>Debugging local front-end pages</strong>: Directly debug local HTML, CSS, and JavaScript files.</li><li><strong>API Mocking scenarios</strong>: Use local JSON files to simulate API responses.</li><li><strong>Static resource serving</strong>: Use a local directory as a static resource server.</li></ul><h2 id="rule-syntax" tabindex="-1">Rule Syntax <a class="header-anchor" href="#rule-syntax" aria-label="Permalink to &quot;Rule Syntax&quot;">​</a></h2><p>The <code>file</code> protocol supports multiple ways to specify local file content:</p><h3 id="_1-inline-value-direct-specification" tabindex="-1">1. Inline Value (Direct Specification) <a class="header-anchor" href="#_1-inline-value-direct-specification" aria-label="Permalink to &quot;1. Inline Value (Direct Specification)&quot;">​</a></h3><p>Write the content to be returned directly in the rule, suitable for short text content. Note: <code>value</code> cannot contain spaces or line breaks.</p><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>pattern file://(value) [lineProps...] [filters...]</span></span></code></pre></div><p><strong>Example:</strong></p><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>www.example.com/api/data file://({&quot;status&quot;:&quot;ok&quot;})</span></span></code></pre></div><p><strong>Note: Inline values must be wrapped in parentheses <code>()</code>; otherwise, they will be interpreted as local file paths, which may lead to 404 errors:</strong></p><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span># Correct: Returns the string &quot;success&quot;</span></span>
<span class="line"><span>pattern file://(success)</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Incorrect: Will be treated as a path, potentially causing 404</span></span>
<span class="line"><span>pattern file://success</span></span></code></pre></div><blockquote><p><strong>Key points about the inline value syntax of the file protocol</strong>:</p><ul><li>Must use <code>()</code> to wrap the content.</li><li>Content cannot contain spaces or line breaks.</li><li>Can be a string, JSON, HTML fragment, etc.</li><li>Without <code>()</code>, Whistle will interpret it as a file path or <code>{key}</code> and attempt to load the corresponding file or key value.</li></ul></blockquote><h3 id="_2-embedded-value-using-code-block" tabindex="-1">2. Embedded Value (Using Code Block) <a class="header-anchor" href="#_2-embedded-value-using-code-block" aria-label="Permalink to &quot;2. Embedded Value (Using Code Block)&quot;">​</a></h3><p>This method is recommended when dealing with complex content containing spaces, line breaks, or when you want to reuse a configuration.</p><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>pattern file://{custom-key.json} [lineProps...] [filters...]</span></span>
<span class="line"><span></span></span>
<span class="line"><span>\`\`\` custom-key.json</span></span>
<span class="line"><span>{</span></span>
<span class="line"><span>  &quot;status&quot;: &quot;success&quot;,</span></span>
<span class="line"><span>  &quot;data&quot;: {</span></span>
<span class="line"><span>    &quot;message&quot;: &quot;Hello from local file&quot;</span></span>
<span class="line"><span>  }</span></span>
<span class="line"><span>}</span></span>
<span class="line"><span>\`\`\`</span></span></code></pre></div><p><strong>Best Practice</strong>: It is recommended to add a response type suffix (e.g., <code>.json</code>, <code>.html</code>, <code>.css</code>) to the <code>key</code>. Whistle will automatically set the correct <code>Content-Type</code> based on the suffix.</p><h3 id="_3-referencing-a-value-from-the-values-panel" tabindex="-1">3. Referencing a Value from the Values Panel <a class="header-anchor" href="#_3-referencing-a-value-from-the-values-panel" aria-label="Permalink to &quot;3. Referencing a Value from the Values Panel&quot;">​</a></h3><p>When the content is large, you can store it in the <code>Values</code> configuration area.</p><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>pattern file://{key-of-values.html} [lineProps...] [filters...]</span></span></code></pre></div><p><strong>Prerequisite</strong>: A key named <code>key-of-values.html</code> with the content to be returned as its value must exist in <code>Values</code>.</p><p><strong>Capacity Recommendations</strong>:</p><ul><li>Content less than 2KB: Recommended to use inline or embedded methods.</li><li>Content between 2KB and 200KB: Recommended to store in <code>Values</code>.</li><li>Content larger than 200KB: Recommended to use local files.</li></ul><h3 id="_4-loading-from-a-temporary-file" tabindex="-1">4. Loading from a Temporary File <a class="header-anchor" href="#_4-loading-from-a-temporary-file" aria-label="Permalink to &quot;4. Loading from a Temporary File&quot;">​</a></h3><p>Use Whistle&#39;s temporary file feature when content needs frequent editing.</p><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>pattern file://temp.html</span></span></code></pre></div><p><strong>Steps:</strong></p><ol><li>In the Rules editor, hold down <code>Command</code> (Mac) / <code>Ctrl</code> (Windows).</li><li>Click with the mouse on <code>file://temp.html</code>.</li><li>Enter the response content in the pop-up editing dialog.</li><li>Click <code>Save</code> to save.</li></ol><p>After saving, the rule will automatically change to a format similar to this:</p><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>https://example.com/report file://temp/11adb9c9e1142df67b30d7646ec59bcd34c855d9011d1a2405c7fc2dfc94568d.html</span></span></code></pre></div><p>To edit again, click the temporary file link in the same way.</p><h3 id="_5-loading-from-a-file-path-or-remote-url" tabindex="-1">5. Loading from a File Path or Remote URL <a class="header-anchor" href="#_5-loading-from-a-file-path-or-remote-url" aria-label="Permalink to &quot;5. Loading from a File Path or Remote URL&quot;">​</a></h3><p>Load the response content from the local file system or a remote URL.</p><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span># Load from a local file</span></span>
<span class="line"><span>pattern file:///User/xxx/test.html</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Load from a remote URL</span></span>
<span class="line"><span>pattern file://https://example.com/template.html</span></span></code></pre></div><h2 id="parameter-details" tabindex="-1">Parameter Details <a class="header-anchor" href="#parameter-details" aria-label="Permalink to &quot;Parameter Details&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:left;">Parameter</th><th style="text-align:left;">Required</th><th style="text-align:left;">Description &amp; Examples</th></tr></thead><tbody><tr><td style="text-align:left;"><strong>pattern</strong></td><td style="text-align:left;">Yes</td><td style="text-align:left;">Expression used to match the request URL.<br>• Supports domains, paths, wildcards, regular expressions.<br>• See <a href="./pattern.html">Matching Pattern Documentation</a> for details.</td></tr><tr><td style="text-align:left;"><strong>value</strong></td><td style="text-align:left;">Yes</td><td style="text-align:left;">The file content or path to return, supporting multiple formats:<br>• Local file or directory path<br>• Remote URL<br>• Inline, embedded, Values references</td></tr><tr><td style="text-align:left;"><strong>lineProps</strong></td><td style="text-align:left;">No</td><td style="text-align:left;">Sets additional properties for the rule.<br><strong>Examples</strong>:<br>• <code>lineProps://important</code>: Increase rule priority.<br>• <code>lineProps://weakRule</code>: When both <a href="./file.html">file</a> and <a href="./proxy.html">proxy</a> rules are configured, the <a href="./proxy.html">proxy</a> rule will be disabled by default. This property can increase the priority of the <a href="./proxy.html">proxy</a> rule.<br>• See <a href="./lineProps.html">lineProps Documentation</a> for details.</td></tr><tr><td style="text-align:left;"><strong>filters</strong></td><td style="text-align:left;">No</td><td style="text-align:left;">Optional filter conditions for precise control over when the rule takes effect.<br>• Can match request URL, method, headers, body content.<br>• Can match response status code, headers.<br>• See <a href="./filters.html">Filters Documentation</a> for details.</td></tr></tbody></table><h2 id="configuration-examples" tabindex="-1">Configuration Examples <a class="header-anchor" href="#configuration-examples" aria-label="Permalink to &quot;Configuration Examples&quot;">​</a></h2><h3 id="_1-basic-file-path-mapping" tabindex="-1">1. Basic File Path Mapping <a class="header-anchor" href="#_1-basic-file-path-mapping" aria-label="Permalink to &quot;1. Basic File Path Mapping&quot;">​</a></h3><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span># Map a domain to a local directory</span></span>
<span class="line"><span>www.example.com/path file:///Users/username/projects/my-site</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Windows system path</span></span>
<span class="line"><span>www.example.com/path file://D:\\projects\\my-site</span></span></code></pre></div><p><strong>Feature Description</strong>:</p><ul><li><strong>Automatic path concatenation</strong>: Accessing <code>https://www.example.com/path/x/y/z</code> will map to <code>/Users/username/projects/my-site/x/y/z</code>.</li><li><strong>Disable path concatenation</strong>: Use <code>&lt; &gt;</code> to wrap the path to disable automatic concatenation.<div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>www.example.com/path file://&lt;/Users/username/projects/my-site/index.html&gt;</span></span></code></pre></div><blockquote><p>Accessing <code>https://www.example.com/path/x/y/z</code> will only return the file <code>/Users/username/projects/my-site/index.html</code>.</p></blockquote></li></ul><h3 id="_2-jsonp-interface-mocking" tabindex="-1">2. JSONP Interface Mocking <a class="header-anchor" href="#_2-jsonp-interface-mocking" aria-label="Permalink to &quot;2. JSONP Interface Mocking&quot;">​</a></h3><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span># Inline method</span></span>
<span class="line"><span>www.example.com/jsonp file://\`(\${query.callback}({&quot;status&quot;:&quot;ok&quot;}))\`</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Embedded method</span></span>
<span class="line"><span>\`\`\` jsonp-response</span></span>
<span class="line"><span>\${query.callback}({</span></span>
<span class="line"><span>  &quot;status&quot;: &quot;error&quot;,</span></span>
<span class="line"><span>  &quot;message&quot;: &quot;Invalid parameter&quot;</span></span>
<span class="line"><span>})</span></span>
<span class="line"><span>\`\`\`</span></span>
<span class="line"><span>www.example.com/jsonp file://\`{jsonp-response}\`</span></span></code></pre></div><blockquote><p><strong>Template String Limitations</strong>: Template strings cannot take effect directly in the following scenarios:</p><ul><li>When referencing local file paths.</li><li>When referencing remote URLs.</li></ul><p>When encountering these limitations, you can use the <a href="./tpl.html">tpl</a> protocol as an alternative.</p></blockquote><h3 id="_3-using-with-filters" tabindex="-1">3. Using with Filters <a class="header-anchor" href="#_3-using-with-filters" aria-label="Permalink to &quot;3. Using with Filters&quot;">​</a></h3><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span># Exclude specific interfaces</span></span>
<span class="line"><span>www.example.com/api/path file:///Users/username/mock-data excludeFilter://*/api/auth</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Match based on request body content</span></span>
<span class="line"><span>www.example.com/api/search file:///Users/username/search-results.json includeFilter://b:/&quot;type&quot;:\\s*&quot;advanced&quot;/i</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Only match POST requests</span></span>
<span class="line"><span>www.example.com/api/submit file:///Users/username/success.json includeFilter://m:POST</span></span></code></pre></div><h3 id="_4-multi-directory-search" tabindex="-1">4. Multi-directory Search <a class="header-anchor" href="#_4-multi-directory-search" aria-label="Permalink to &quot;4. Multi-directory Search&quot;">​</a></h3><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span># Multiple files or directories separated by \`|\`</span></span>
<span class="line"><span>www.example.com/static/path file:///path/to/project1|/path/to/project2|/path/to/project3</span></span></code></pre></div><p><strong>Search Logic</strong>:</p><ol><li>Check each directory in order: <ul><li><code>/path/to/project1/static/file.js</code></li><li><code>/path/to/project2/static/file.js</code></li><li><code>/path/to/project3/static/file.js</code></li></ul></li><li>Return the first existing file found.</li><li>If none are found, return <code>404 Not Found</code>.</li></ol><h2 id="advanced-usage" tabindex="-1">Advanced Usage <a class="header-anchor" href="#advanced-usage" aria-label="Permalink to &quot;Advanced Usage&quot;">​</a></h2><h3 id="dynamic-path-handling" tabindex="-1">Dynamic Path Handling <a class="header-anchor" href="#dynamic-path-handling" aria-label="Permalink to &quot;Dynamic Path Handling&quot;">​</a></h3><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span># Use regex capture groups</span></span>
<span class="line"><span>/^https?://www\\.example\\.com/user/(\\d+)/profile file:///Users/username/mock/profiles/user-$1.json</span></span>
<span class="line"><span></span></span>
<span class="line"><span># If not limited to numbers, you can use wildcards</span></span>
<span class="line"><span>^www.example.com/user/*/profile file:///Users/username/mock/profiles/user-$1.json</span></span></code></pre></div><h3 id="environment-specific-configuration" tabindex="-1">Environment-Specific Configuration <a class="header-anchor" href="#environment-specific-configuration" aria-label="Permalink to &quot;Environment-Specific Configuration&quot;">​</a></h3><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>\`\`\` dev-config</span></span>
<span class="line"><span>{</span></span>
<span class="line"><span>  &quot;apiBase&quot;: &quot;http://localhost:3000&quot;,</span></span>
<span class="line"><span>  &quot;debugMode&quot;: true</span></span>
<span class="line"><span>}</span></span>
<span class="line"><span>\`\`\`</span></span>
<span class="line"><span></span></span>
<span class="line"><span>\`\`\` prod-config</span></span>
<span class="line"><span>{</span></span>
<span class="line"><span>  &quot;apiBase&quot;: &quot;https://api.example.com&quot;,</span></span>
<span class="line"><span>  &quot;debugMode&quot;: false</span></span>
<span class="line"><span>}</span></span>
<span class="line"><span>\`\`\`</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Determine if it&#39;s a development environment via cookie: env=dev</span></span>
<span class="line"><span>www.example.com/config file://{dev-config} includeFilter://reqH:cookie=/env=dev/</span></span>
<span class="line"><span>www.example.com/config file://{prod-config} # Default production environment</span></span></code></pre></div><h3 id="combining-with-other-protocols" tabindex="-1">Combining with Other Protocols <a class="header-anchor" href="#combining-with-other-protocols" aria-label="Permalink to &quot;Combining with Other Protocols&quot;">​</a></h3><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span># First use file to provide static files, then set response headers</span></span>
<span class="line"><span>www.example.com file:///Users/username/static-files cache://3600</span></span>
<span class="line"><span></span></span>
<span class="line"><span># For non-existent files, use xfile to allow the request to continue</span></span>
<span class="line"><span>www.example.com xfile:///Users/username/static-files</span></span></code></pre></div><h2 id="differences-from-resbody" tabindex="-1">Differences from resBody <a class="header-anchor" href="#differences-from-resbody" aria-label="Permalink to &quot;Differences from resBody&quot;">​</a></h2><p>The main distinctions between the <code>file</code> protocol and the <a href="./resBody.html"><code>resBody</code></a> protocol lie in the request processing flow and response mechanism:</p><p><strong><code>file</code> Protocol:</strong></p><ul><li><strong>Request Flow</strong>: Requests matching the <code>file</code> protocol are <strong>not sent to the backend server</strong>.</li><li><strong>Response Mechanism</strong>: Directly returns the content of the specified file with a 200 status code.</li><li><strong>Network Overhead</strong>: Zero network latency; entirely processed locally.</li></ul><p><strong>Diagram:</strong></p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>Client Request → Whistle (matches file rule) → Reads Local File → Returns Response (200)</span></span>
<span class="line"><span>                        ↓</span></span>
<span class="line"><span>                  (Not sent to server)</span></span></code></pre></div><p><strong><code>resBody</code> Protocol:</strong></p><ul><li><strong>Request Flow</strong>: The request <strong>is first sent to the backend server</strong> to obtain the original response.</li><li><strong>Response Mechanism</strong>: After receiving the server&#39;s response, <strong>replaces</strong> the original response body with the specified content.</li><li><strong>Network Overhead</strong>: Includes a complete request-response network round trip.</li></ul><p><strong>Diagram:</strong></p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>Client Request → Whistle → Sends to Server → Receives Original Response → Replaces Response Body → Returns Modified Response</span></span></code></pre></div><h2 id="related-protocols" tabindex="-1">Related Protocols <a class="header-anchor" href="#related-protocols" aria-label="Permalink to &quot;Related Protocols&quot;">​</a></h2><ol><li><p><strong>Allow unmatched files to continue access</strong>: <a href="./xfile.html">xfile</a></p><ul><li>When a local file does not exist, allow the request to continue to the original server.</li><li>Suitable for development scenarios with static resource servers.</li></ul></li><li><p><strong>Replace with remote URL content</strong>: <a href="./https.html">https</a> or <a href="./http.html">http</a></p><ul><li>Use content from a remote server as the response.</li><li>Note: It is not recommended to use the form <code>file://https://xxx</code>.</li></ul></li><li><p><strong>Domain resolution redirection</strong>: <a href="./host.html">host</a></p><ul><li>Modify domain name resolution to direct requests to a specified IP.</li></ul></li><li><p><strong>Template rendering</strong>: <a href="./tpl.html">tpl</a></p><ul><li>Supports more complex template rendering and dynamic content generation.</li></ul></li></ol><h2 id="notes" tabindex="-1">Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;Notes&quot;">​</a></h2><h3 id="path-handling" tabindex="-1">Path Handling <a class="header-anchor" href="#path-handling" aria-label="Permalink to &quot;Path Handling&quot;">​</a></h3><ol><li><strong>Relative paths</strong>: Except for rules inside plugins, it is not recommended to use relative paths. Relative paths are relative to the directory where the Whistle configuration file is located.</li><li><strong>Absolute paths</strong>: System absolute paths are supported.</li><li><strong>User directory</strong>: <code>~</code> is supported to represent the user&#39;s home directory.</li><li><strong>Windows paths</strong>: Mixing <code>/</code> and <code>\\</code> as path separators is supported.</li></ol><h3 id="file-encoding" tabindex="-1">File Encoding <a class="header-anchor" href="#file-encoding" aria-label="Permalink to &quot;File Encoding&quot;">​</a></h3><ol><li><strong>Text files</strong>: UTF-8 encoding is used by default.</li><li><strong>Encoding issues</strong>: If you encounter garbled characters, check the actual encoding format of the file.</li></ol><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h2><h3 id="q-file-not-found-404" tabindex="-1">Q: File Not Found (404) <a class="header-anchor" href="#q-file-not-found-404" aria-label="Permalink to &quot;Q: File Not Found (404)&quot;">​</a></h3><p><strong>A:</strong> Check:</p><ol><li>Whether the file path is correct.</li><li>Whether the file exists and has read permissions.</li><li>Whether <code>&lt; &gt;</code> was used to disable path concatenation.</li></ol><h3 id="q-garbled-characters" tabindex="-1">Q: Garbled Characters <a class="header-anchor" href="#q-garbled-characters" aria-label="Permalink to &quot;Q: Garbled Characters&quot;">​</a></h3><p><strong>A:</strong> Check:</p><ol><li>The actual encoding format of the file.</li><li>Whether the <code>Content-Type</code> response header is correct.</li><li>Whether the file content contains illegal characters.</li></ol><h3 id="q-rule-not-taking-effect" tabindex="-1">Q: Rule Not Taking Effect <a class="header-anchor" href="#q-rule-not-taking-effect" aria-label="Permalink to &quot;Q: Rule Not Taking Effect&quot;">​</a></h3><p><strong>A:</strong> Check:</p><ol><li>Whether the rule pattern matches correctly.</li><li>Whether other rules are overriding it.</li><li>Whether the filter conditions are met.</li></ol><h3 id="q-template-strings-not-taking-effect" tabindex="-1">Q: Template Strings Not Taking Effect <a class="header-anchor" href="#q-template-strings-not-taking-effect" aria-label="Permalink to &quot;Q: Template Strings Not Taking Effect&quot;">​</a></h3><p><strong>A:</strong> Check:</p><ol><li>Whether template strings are used in file path or remote URL scenarios.</li><li>If so, use the <a href="./tpl.html">tpl</a> protocol instead.</li></ol><h2 id="further-reading" tabindex="-1">Further Reading <a class="header-anchor" href="#further-reading" aria-label="Permalink to &quot;Further Reading&quot;">​</a></h2><ul><li><a href="./pattern.html">Matching Pattern Documentation</a>: Learn more about URL matching rules.</li><li><a href="./operation.html">Operation Commands Documentation</a>: Learn about multiple ways to load content.</li><li><a href="./lineProps.html">Additional Configuration</a>: Learn more about special features.</li><li><a href="./filters.html">Filters</a>: Learn more about filter functionalities.</li></ul>`,89)]))}const g=a(o,[["render",i]]);export{u as __pageData,g as default};
